ush(getSeriesOptions('Mean', '#66FF00'));            if(maxSingleMean){              lines.push(maxSingleMeanArray);              series.push(getSeriesOptions('Max Single Mean (*)', '#EBFF00'));              lines.push(singleMeanArray);              series.push(getSeriesOptions('Single mean', '#FC6333'));            }            if(areThereSomeErrors > 0){              lines.push(errorsArray);              series.push({                showLine:false,                 markerOptions: { size: 7, style:"x" },                label: 'Errors',                 color: '#FF0000'              });            }            var options = {              title: {                text: data.benchmark[serviceName][routeName]['name'],                color: '#F1F1F1'              },              animate: true,              grid: {                background: '#000000', textColor: '#F1F1F1'              },              seriesDefaults:{                rendererOptions: {                  showDataLabels: true                }              },              highlighter: {                show: true,                sizeAdjust: 7.5              },              legend: {                 show:true,                 location: 'se',                 background: 'rgba(101, 0, 253, 0.89)'              },              axesDefaults: {                labelRenderer: $.jqplot.CanvasAxisLabelRenderer              },              axes: {                xaxis: {                   label: "Samples",                   pad: 0                },                yaxis: {                   label: "Response time (seconds)",                   tickOptions: {                    formatString:'%.6f'                  }                }              },              series: series            };            var plot = $.jqplot('chart' + counter, lines, options);            counter++;          }        }      });    </script>  </body></html>
